function generateDataCollection() {
  const promises = [];
  for (let i = 0; i < 10; i++) {
    promises.push(fetch('https://dog.ceo/api/breeds/image/random'));
  }

  const collectedData = [];

  Promise.all(
    promises.map((singlePromise, uid) => {
      const newData = {};
      singlePromise
        .then(res => res.json())
        .then(data => {
          newData.id = uid;
          newData.name = `Doggie ${newData.id}`;
          newData.imageUrl = data.message;
          newData.price = Math.floor(Math.random() * 10) + 1;
          collectedData.push(newData);
        });
      console.log(newData);
    }),
  );
}

export default generateDataCollection;
